INSERT INTO `crmmex_sis_predefinido` VALUES (1,'PropuestaIdtyNomenclatura','Propuesta_inicialesEjecutivo_autoincremento',1),(2,'TextoCondicionesPoliticas','1. Proemio\nAl ingresar y utilizar este portal de Internet, cuyo nombre de dominio es mexagon.net, propiedad Mexagon, que en lo sucesivo se denominará Mexagon S.A. de C.V., el usuario está aceptando los TÉRMINOS Y CONDICIONES DE USO contenidos en este convenio y declara expresamente su aceptación utilizando para tal efecto medios electrónicos, en términos de lo dispuesto por el artículo 1803 del Código Civil Federal.\n\nEn caso de no aceptar en forma absoluta y completa los términos y condiciones de este convenio, el usuario deberá abstenerse de acceder, utilizar y observar el sitio web mexagon.net.\n\nY en caso de que el usuario acceda, utilice y observe el sitio web mexagon.net se considerará como una absoluta y expresa aceptación de los TÉRMINOS Y CONDICIONES DE USO aquí estipulados.\n\nLa sola utilización de dicha página de Internet le otorga al público en general la condición de usuarios e implica la aceptación, plena e incondicional, de todas y cada una de las condiciones generales y particulares incluidas en estos TÉRMINOS Y CONDICIONES DE USO publicados por Mexagon S.A. de C.V., en el momento mismo en que el usuario acceda al sitio web.\n\nCualquier modificación a los presentes TÉRMINOS Y CONDICIONES DE USO será realizada cuando el titular de la misma, en este caso Mexagon S.A. de C.V., lo considere apropiado, siendo exclusiva responsabilidad del usuario asegurarse de tomar conocimiento de tales modificaciones.\n\n2. Convenio\nConvenio de adhesión para el uso de la página de Internet mexagon.net que celebran: por una parte, Mexagon S.A. de C.V. y por la otra, el usuario, sujetándose, ambas partes, a lo establecido en este documento. Actualizado.',1),(3,'DiasVigenciaPropuesta','60',1),(4,'MinutosDisponiblesSeguimiento','00,15,25,30,45,50,55',1);
