INSERT INTO `crmmex_sis_procesos` VALUES (1,'Alta registro prospecto','Se ha dado el alta el registro en el apartado de \"Prospectos\" con la información mínima necesaria para inicar el seguimiento.',1),(2,'Seguimiento','Se ha creado el primer registro de seguimiento relativo al prospecto/cliente',1),(3,'Cotización (Creación)','Se ha creado una cotización como parte del seguimiento a un prospecto',1),(4,'Cotización (Envío)','Se ha enviado la cotización al prospecto, esto como parte del seguimiento sobre el mismo',1),(5,'Contacto','Se ha llevado a cabo contacto con el prospecto como parte del seguimiento',1),(6,'Pago','Se ha generado un registro de pago sobre una cotización elaborada y enviada',1),(7,'Alta cliente','Se ha generado el proceso de transición de Prospecto a Cliente',1);
